import React from 'react'

import './header.css'

const Header = () => {
   return(
       <div className="header d-flax">
       <h3>
           <a href >
               Star DB
           </a>
       </h3>
       <ul>
           <li>
               <a href = "#">People</a>
           </li>
           <li>
               <a href = "#">Planet</a>
           </li>
           <li>
               <a href = "#">StarShip</a>
           </li>
       </ul>
       </div>
   );
};

export default Header;


